import Head from 'next/head';

import 'bootstrap/dist/css/bootstrap.min.css';
import '../styles/global.css';
import '../styles/toasty.css';
import '../styles/depoiments.css';
import '../styles/rumours.css';
import '../styles/follow-me.css';
import '../styles/dark-side.css';

export default function App({ Component, pageProps }) {
  return (
    <div>
      <Head>
        <meta name="viewport" content="width=device-width, initial-scale=1" />
        <meta charSet="utf-8" />

        <meta
          name="description"
          content="My own very personal website! Such technological! Much digital!"
        ></meta>

        <meta
          property="og:title"
          content="Do you need a Patric?"
          key="ogtitle"
        />

        <meta
          property="og:description"
          content="Of course you do, 'cause this is a retorical question."
          key="ogdesc"
        />

        <meta
          property="og:image"
          content={require('./images/social-media.jpg')}
          key="ogimage"
        />

        <link
          rel="icon"
          type="image/png"
          sizes="16x16"
          href="data:image/png;base64,
        "
        />
      </Head>

      <Component {...pageProps} />
    </div>
  );
}
